import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { createStore, applyMiddleware, compose } from "redux";
import { Provider } from "react-redux";
import thunk from "redux-thunk";
import rootReducer from "./Components/Store/Reducer";
import { reactReduxFirebase } from "react-redux-firebase";
import { reduxFirestore, getFirestore } from "redux-firestore";
import firebase from "firebase";
// import fbconfig from "./Components/Config/fbconfig";

const fbconfig = {
  apiKey: "AIzaSyDxxlGXVzfB4zy6Ew9ENKy278fZmZlJ6ZE",
  authDomain: "my-project-1ac66.firebaseapp.com",
  databaseURL: "https://my-project-1ac66.firebaseio.com",
  projectId: "my-project-1ac66",
  storageBucket: "my-project-1ac66.appspot.com",
  messagingSenderId: "946362434520",
  appId: "1:946362434520:web:35be3db5cf6522fc"
}

firebase.initializeApp(firebaseConfig);

const config = {
  userProfile: "",
  enableLogging: "false"
};

const a = compose(reactReduxFirebase(firebase, config))(createStore);

const store = a(
  rootReducer,
  compose(
    applyMiddleware(thunk.withExtraArgument({ getFirestore })),
    reduxFirestore(fbconfig)
  )
);

ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  document.getElementById("root")
);
